  "HR.ORTHOIMAGERY.ORTHOPHOTOS": {"layer":"HR.ORTHOIMAGERY.ORTHOPHOTOS","key":"","theme":"ortho","desc":"Le produit BD ORTHO® V3 est une collection de mosaïques d'orthophotographies numériques en couleurs ou en Infra Rouge couleurs, rectifiées dans la projection adaptée au territoire couvert. La BD ORTHO® V3 se compose d'images numériques (sans habillage ni surcharge) et d'indications de géoréférencement. Le contenu informationnel permet localement une utilisation jusqu'au 1 :2,000ième pour mettre en valeur le territoire, enrichir la visualisation des données et des projets.","server":"https://data.geopf.fr/wmts","bbox":[-180,-90,180,90],"format":"image/jpeg","minZoom":6,"maxZoom":19,"originators":{"Geoservices":{"attribution":"Géoservices","href":"https://geoservices.ign.fr/"}},"queryable":true,"style":"normal","tilematrix":"PM","title":"Ortho 20 cm"},
  "HYDROGRAPHY.BCAE.2020": {"layer":"HYDROGRAPHY.BCAE.2020","key":"","theme":"topographie","desc":"Le code rural et de la pêche maritime prévoit que les agriculteurs qui demandent des aides de la PAC implantent des bandes enherbées le long de certains cours d’eau au titre des bonnes conditions agricoles et environnementales (BCAE). Cette carte représente les cours d’eau concernés pour les départements listés ci-dessous. Pour les autres départements, veuillez-vous référer à l’arrêté du 24 avril 2015 relatif aux BCAE Cette carte est en vigueur du 1er janvier 2020 au 31 décembre 2020.","server":"https://data.geopf.fr/wmts","bbox":[-5.15047,41.3252,9.57054,51.0991],"format":"image/png","minZoom":6,"maxZoom":17,"originators":{"Geoservices":{"attribution":"Géoservices","href":"https://geoservices.ign.fr/"}},"queryable":false,"style":"nolegend","tilematrix":"PM","title":"Cours d'eau BCAE 2020"},
  "HYDROGRAPHY.BCAE.2021": {"layer":"HYDROGRAPHY.BCAE.2021","key":"","theme":"topographie","desc":"Identification des cours d'eau concernés par les règles des bonnes conditions agricoles et environnementales (BCAE) en 2021 pour les départements métropolitains. Le code rural et de la pêche maritime prévoit que les agriculteurs qui demandent des aides de la PAC implantent des bandes enherbées le long de certains cours d'eau au titre des bonnes conditions agricoles et environnementales. Cette carte est en vigueur du 1er janvier 2021 au 31 décembre 2021. Pour les départements non métropolitains, veuillez-vous référer aux arrêtés préfectoraux relatifs aux BCAE.","server":"https://data.geopf.fr/wmts","bbox":[-5.15047,41.3252,9.57054,51.0991],"format":"image/png","minZoom":6,"maxZoom":17,"originators":{"Geoservices":{"attribution":"Géoservices","href":"https://geoservices.ign.fr/"}},"queryable":false,"style":"nolegend","tilematrix":"PM","title":"Cours d'eau BCAE 2021"},
