  "LANDCOVER.HR.WAW.CLC15": {"layer":"LANDCOVER.HR.WAW.CLC15","key":"","theme":"clc","desc":"Les couches haute résolution sont des couches thématiques d’occupation des sols, produites par le service Territoire du programme européen d'observation de la Terre Copernicus. Ce programme est coordonné par la Commission européenne et associe l’Agence spatiale européenne, l’Agence européenne pour l’environnement ainsi que les États membres. Ces données sont produites automatiquement à partir d’images satellite. Elles sont ensuite vérifiées puis améliorées manuellement. La production et la diffusion de ces couches haute résolution sont pilotées par l'Agence européenne pour l'environnement. Pour la France, le Service de l'observation et des statistiques du ministère chargé de l'environnement a la responsabilité des vérifications et des améliorations de ces produits. Les zones humides et surfaces en eaux permanentes cartographient la présence ou non de surfaces en eau permanentes et la présence ou non de zones humides. Ces surfaces sont identifiées à partir d’analyses d’images satellite prises à différentes saisons (de 4 à 5 images en moyenne) et différentes années. Sont ainsi cartographiées les surfaces en eau sur plusieurs dates de l’analyse. Les zones humides sont définies comme étant les zones où l'eau est le premier facteur d'influence de l'environnement et de la faune et de la flore associées. Elles surviennent là où la nappe phréatique affleure ou est proche de la surface du sol, ou quand la terre est recouverte d'une faible épaisseur d'eau. Les zones cartographiées sont recouvertes d'eau au moins une fois l'une des années observées ou présentent une humidité importante et constante. Elles sont situées dans des zones où la pente est inférieure à 10 %. Enfin, les zones cartographiées sont majoritairement couvertes d’hydrophytes ou de macrophytes. La surface minimale cartographiée est de 0,16 ha, ce qui correspond à un groupement de 4 pixels. Les valeurs cartographiées sont : - 0 : Zone non-humide - 1 : Surface en eau permanente - 2 : Surface en eau temporaire - 3 : Zone humide permanente - 4 : Zone humide temporaire - 254 : Inclassable (nuage, donnée satellite indisponible, ombre ou neige) - 255 : En dehors de la zone d'étude Ces données haute résolution peuvent être utilisées indépendamment ou en complément de CORINE Land Cover. En effet, CLC permet de cartographier des polygones homogènes d’occupation des sols tels que du tissu urbain discontinu et des zones industrielles ou commerciales. Les couches haute résolution permettent alors d’apporter une nouvelle information pour chacune de ces zones, en précisant leur degré d’imperméabilisation, leur taux de couvert arboré, etc.","server":"https://data.geopf.fr/wmts","bbox":[-180,-89,180,89],"format":"image/png","minZoom":0,"maxZoom":13,"originators":{"Geoservices":{"attribution":"Géoservices","href":"https://geoservices.ign.fr/"}},"queryable":false,"style":"CORINE Land Cover - HR - zones humides et surfaces en eaux permanentes","tilematrix":"PM","title":"Raster CORINE Land Cover - Couche haute résolution des zones humides et surfaces en eaux permanentes - Résolution 20m - 2012"},
