  "SPOT5_PYR-JPEG_WLD_WM": {"layer":"SPOT5_PYR-JPEG_WLD_WM","key":"","theme":"satellite","desc":"Cette couche est formée d'images prises par le satellite SPOT 5 en 2009 et 2010 depuis une altitude de 800 km. La résolution des images initiales est de 2,5 mètres/pixel, ce qui permet d'identifier l'existence de bâtiments, routes et chemins, et sa précision est homogène avec celle du référentiel à Grande Echelle. Le satellite SPOT 5 est exploité depuis 2002 par le Centre national d'études spatiales (CNES) et les images sont distribuées par la société Spot Image (Astrium GEO-Information Services). L'expertise de l'IGN menée à la demande du CNES a permis d'affiner les performances géométriques du capteur SPOT5, dans l'intérêt de tous les utilisateurs. La couche \" SPOT 5 \" visible sur Géoportail est issue de la co-édition Reference3D® entre Spot Image et l'IGN. Aucune légende n'est associée à cette couche. La radiométrie des images est traitée par des couleurs naturelles.","server":"https://data.geopf.fr/wmts","bbox":[-2.10938,41.9023,5.09766,46.0732],"format":"image/png","minZoom":6,"maxZoom":16,"originators":{"Geoservices":{"attribution":"Géoservices","href":"https://geoservices.ign.fr/"}},"queryable":false,"style":"normal","tilematrix":"PM","title":"SPOT 5 sud-ouest 2009-2010"},
